import React, { useState, useEffect } from "react";

function Not({ not }) {
  const [oncelikText, setOncelikText] = useState("");

  useEffect(() => {
    switch (not.oncelik) {
      case 1:
        setOncelikText("Az oncelikli");
        break;
      case 2:
        setOncelikText("oncelikli");
        break;
      case 3:
        setOncelikText("cok oncelikli");
        break;

      default:
        break;
    }
    console.log(oncelikText);
  });

  return <div>{not}</div>;
}

export default Not;
